import React, { Component } from 'react';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import Todo from './Todo';
import '../styles/TodoList.css'



class TodoList extends Component {
  constructor(props){
    super(props);
    this.toDoListRemove=this.toDoListRemove.bind(this)
}
toDoListRemove(id){
    //actual delete will happen in todoAPP
    this.props.toDoAppremoveTask(id);
}
render(){
return(<ul>{this.props.tasks.map(todo=>
<div className={'root'}>
          <GridList cellHeight={180} className={'gridList'}>
            <GridListTile  cols={3} style={{ height: 'auto' }}>
            <Todo toDoListRemove= {this.toDoListRemove} key={todo.id} todo= {todo}/>
         </GridListTile>

          </GridList>
</div>)}</ul>
        );
    }

  }

  export default TodoList
